import React from 'react';
import '../styles/App.css';


function Footer()
{
return(<div>
<footer className="footer">

<section>
  <footer>
    <a href="https://www.linkedin.com/in/danielbaloy/"><img alt="" src="./images/"></img></a>
    <a href="https://github.com/baloyd"><img alt="" src="./images/GitHub-Mark-Light-120px-plus.png"></img></a>
    <a href="https://www.instagram.com/danielbaloy/">Instagram</a>
  </footer>
</section>
</footer>
</div>
)
}


export default Footer;
